spring.profiles.active=@spring.profiles.active@
spring.datasource.jndi-name=${QA_NABHI_JDB_DATASOURCE}
spring.jpa.open-in-view=false
spring.jpa.hibernate.use-new-id-generator-mappings=true
spring.jpa.properties.hibernate.dialect=org.hibernate.dialect.MySQL5InnoDBDialect
spring.jpa.properties.hibernate.format_sql=true
spring.jpa.show-sql=false
spring.jpa.hibernate.naming.implicit-strategy=org.hibernate.boot.model.naming.ImplicitNamingStrategyLegacyJpaImpl
spring.jpa.hibernate.naming.physical-strategy=org.springframework.boot.orm.jpa.hibernate.SpringPhysicalNamingStrategy
protocol=${QA_NABHI_PROTOCOL}
jke.host=${QA_NABHI_JKE_HOST}
jke.frame=${QA_NABHI_JKE_FRAME}
jke.path=${QA_NABHI_JKE_PATH}
iso.host=${QA_NABHI_ISO_HOST}
iso.frame=${QA_NABHI_ISO_FRAME}
iso.path=${QA_NABHI_ISO_PATH}
jse.prikey=${QA_NABHI_JSE_PRIKEY}
jse.tkn.local=${QA_NABHI_JSE_TKN_LOCAL}
app.tkn.user=${QA_NABHI_JSE_TKN_USER}
app.tkn.pwd=${QA_NABHI_JSE_TKN_PWD}
app.endpoints=\
  JKE,${protocol}${jke.host}:${jke.frame}${jke.path};\
  ISO,${protocol}${iso.host}:${iso.frame}${iso.path};
idf.owner.fiid=B132